import { useEffect } from "react";
import { Block } from "@material-ui/icons";
import "./Card.css";
import imgs from "./data";
import "./Offer.css";
const Card = (property) => {
  const index = property.property;
  const len = imgs.properties.length + 1;
  const p = imgs.properties[index % len];
  const picture = p.picture;
  const f = p.index;

  return (
    <div
      id={"card-${index}"}
      className="card animateimage"
      onAnimationIteration={property.animat}
    >
      <img src={picture} className="image"></img>
    </div>
  );
};
export default Card;
